webpackJsonp([0xd355161ab8c],{805:function(e,t){e.exports={data:{site:{siteMetadata:{title:"weiran.co",author:"Weiran Zhang"}},markdownRemark:{id:"/Users/weiran/git/weiran/weiran.co/src/pages/blog/2013/2/google-has-killed-the-android-brand/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>I have seen the Android brand disappear over time. First, it was the Nexus, then Samsung came with the Galaxy brand, who made Android less relevant. Now, Android is just invisible.</p>\n<p>I thought Google was losing a war against its partners, but I finally concluded that it cannot be just a coincidence. It is not just a trend. It is a deliberate effort. By Google.</p>\n</blockquote>\n<p>Google wants Google to be the brand, not Android.</p>\n<p><em>Update</em>: I canâ€™t find any mention of Android in the <a href="http://web.archive.org/web/20100319002511/http://www.google.com/phone">original Google Nexus site</a>, apart from once in the specification.</p>',frontmatter:{title:"Google has killed the Android brand",date:"February 21, 2013",passthroughUrl:"http://www.fabcapo.com/2013/02/google-has-killed-android-brand.html"}}},pathContext:{slug:"/blog/2013/2/google-has-killed-the-android-brand/",previous:{fields:{slug:"/blog/2013/2/innovation/"},frontmatter:{title:"'Innovation'",passthroughUrl:"http://ihkdesigns.wordpress.com/2013/02/19/idiots-are-everywhere/"}},next:{fields:{slug:"/blog/2013/2/movist/"},frontmatter:{title:"Movist",passthroughUrl:null}}}}}});
